8th street latinas -&gt; Jessica - Chongalicious

Cast

Cris Cummando Jessica

Fri January 07, 2011
We ended up meeting this Cuban cutie at the mall this week who was eager to come party. She was hanging around eating when we spotted her all alone. We offered her a ride to come to a party at the house and she was all about it. Once at the house she got right into action with no shyness. This Latina is on Fire!
